import './css/Learning.css';
import React, { useState, useEffect } from 'react';
import { Document, Page, pdfjs } from 'react-pdf';

function Button({ name, src, alt, onClick }) {
    return (
        <img
            src={src}
            className={name}
            alt={alt}
            onClick={onClick}
        />
    );
}
